E_D("replace into `qb_reply` values('73','','0','0','0','0','0','<p>&nbsp;&nbsp; 诸位站长、企业用户及关注qibosoft的同仁朋友： <br />\r\n&nbsp;&nbsp; 欢迎使用qibosoft整站系统,目前默认安装的系统,虽然标题不一样.但内容都是一样的.这仅仅是演示数据而已,请不要误会系统出了问题。</p>\r\n','0');");
E_D("replace into `qb_reply` values('647','','0','666','41','1','1','&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 矿山机械、工程机械所活跃的地方，多为山区及沙漠地带等远离人类普通生活的开采工地，有时甚至工作于地下2000米之处。这类机械种类繁多，从矿物粉碎机械到切削机械、筛选机械、装载机械、输送机械等，都是每天24小时连续运转的设备。这些机械中不论哪种机械发生了故障，都会给开采现场的生产造成很大影响，而且，由于近来机械的大型化，也使维修作业变得非常艰辛。 因此，在轴承的使用环境方面，&ldquo;重载荷＋冲击载荷&rdquo;、&ldquo;轻载荷＋高速旋转&rdquo;、&ldquo;重载荷＋低速旋转&rdquo;等对轴承而言非常苛刻的条件很多。因此，用户所渴望的轴承，是具备能抵抗这些恶劣工况的坚固性、耐久性及高可靠性的产品。','0');");
E_D("replace into `qb_reply` values('648','','0','667','41','1','1','<span style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; letter-spacing: normal; display: inline !important; font: 13px/18px verdana, sans-serif; white-space: normal; orphans: 2; float: none; color: rgb(94,94,94); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\"><span class=\"Apple-converted-space\">&nbsp;&nbsp;&nbsp;&nbsp;<font color=\"#5e5e5e\">工程机械有起重机、挖掘机、推土机、压路机、运土机等，工程机械工作环境恶劣，尘埃多，负荷重，机械故障多，工作时间长。 大连光扬轴承制造有限公司提供的转盘轴承、深沟球轴承、圆柱滚子轴承、调心滚子轴承、圆锥滚子轴承，均具有负荷容量大，性能高，使用寿命长等优点，可确保设备在恶劣环境下平稳的运行。<span _fck_bookmark=\"1\" style=\"display: none\">&nbsp;</span></font></span></span>','0');");
E_D("replace into `qb_reply` values('682','','0','701','53','1','1','<p>双列圆锥滚子轴承圆锥滚子轴承的内外圈具有锥形滚道,滚道之间装有锥形滚子。若将锥形面延伸,最终会聚于轴承轴线上&nbsp;一点。圆锥滚子轴承主要用于承受以径向载荷为主的径向、轴向联合载荷,轴承的轴向承载能力由接触角决定,&nbsp;角度值越大,轴向承载能力越大。<br />1.&nbsp;结构型式双列圆锥滚子轴承主要有两种结构型式&nbsp;:&nbsp;TDO结构式(350000系列):一双滚道外圈和两个内圈,两个内圈间有一内隔圈(或无内隔圈),改变&nbsp;隔圈的厚度可以调整轴承的游隙。&nbsp;TDI结构型式(IDTB系列):一双滚道内圈和两个圈,两个外圈间有一外隔圈(或无外隔圈),改变隔圈&nbsp;的厚度可以调整轴承的游隙。<br />2.&nbsp;保持架当轴承公称外径&nbsp;D&nbsp;≤&nbsp;650mm&nbsp;时,采用钢板冲压保持架&nbsp;;&nbsp;当轴承公称外径&nbsp;D&nbsp;&gt;&nbsp;650mm&nbsp;时,采用钢制实体支柱保持架。<br />3.&nbsp;允许轴线角度误差双列圆锥滚子轴承外圈相对于内圈的轴线角度误差只能由滚子和滚道之间强力承受。这会引起轴承偏载,&nbsp;应当尽可能避免。<br />4.&nbsp;径向当量动载荷当Fa/Fr≤e&nbsp;Pr=Fr+Y1Fa&nbsp;当Fa/Fr&gt;e&nbsp;Pr=0.67Fr+Y2Fa&nbsp;5.&nbsp;径向当量静载荷&nbsp;Por=Fr+Y0Fa&nbsp;6.&nbsp;轴向游隙双列圆锥滚子轴承的轴向游隙可按以下公式进行计算&nbsp;:&nbsp;Ga=Gr×Ctgα&nbsp;或&nbsp;Ga&nbsp;=&nbsp;Gr×1.5/e&nbsp;式中&nbsp;:Ga―轴承的轴向游隙&nbsp;Gr―轴承的径向游隙&nbsp;α―外圈的滚道角度<br /></p><table style=\"width:583px;border-collapse:collapse\" width=\"583\" height=\"608\"><colgroup><col width=\"61\" /><col width=\"36\" /><col width=\"22\" /><col width=\"19\" /><col width=\"21\" /><col width=\"24\" /><col width=\"20\" /><col width=\"38\" /><col width=\"45\" /><col width=\"40\" /><col width=\"46\" /><col width=\"73\" /><col width=\"66\" /><col width=\"72\" /><tbody><tr height=\"19\"><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:61px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"61\">型号</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:36px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"36\">原代号</td><td style=\"border-