E_D("replace into `qb_reply` values('649','','0','668','41','1','1','&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 冶金设备种类繁多，不仅有原料厂所需设备，还包括炼钢工序、轧钢工序、平整工序等从上游工序到下游工序所需的设备。这些设备上，装有各种轴承。这些轴承是在冶金设备特有的&ldquo;铁粉&rdquo;、&ldquo;水&rdquo;、&ldquo;热&rdquo;工况下使用，而且还要满足&ldquo;重载荷 + 振动冲击&rdquo;、&ldquo;从超低速到高速 + 急加减速&rdquo;等使用条件，在其持有的非常恶劣工况下使用。 &ldquo;稳定运转及提高生产效率&rdquo;，可谓是冶金设备领域中具有代表性产业的命题。NSK以此命题为目标做出贡献，不仅在高度的轴承设计技术方面，还从轴承材料技术、润滑技术、解析技术等内在的各种角度，每天推进相应措施及研发工作。为此，NSK长期来一直致力于解决&ldquo;轴承的长寿命及高可靠性&rdquo;这一永远的课题。 ZWA拥有各种冶金设备所需的轴承，产品阵容强大，包括从ISO规格的标准轴承到独自开发的高功能专用轴承等各种产品。此外，我们还针对近来冶金行业对高附加价值产品及环保型产品的需求，采取相应措施，提供新的解决方案。 ','0');");
E_D("replace into `qb_reply` values('650','','0','669','41','1','1','<p>\r\n	<span style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; letter-spacing: normal; display: inline !important; font: 13px/18px verdana, sans-serif; white-space: normal; orphans: 2; float: none; color: rgb(94,94,94); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\"><span class=\"Apple-converted-space\"><span style=\"font-size: 14px\">&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"font-size: 12px\">&nbsp; 石油化学工业是基础性产业，它为农业、能源、交通、机械、电子、纺织、轻工、建筑、建材等工农业和人民日常生活提供配套和服务，在国民经济中占有举足轻重的地位。</span></span><span style=\"font-size: 12px\">石油化工设备配套和维修用的轴承、机械密封件和填料静密封等的市场年需求量增长较大。&nbsp;</span><span _fck_bookmark=\"1\" style=\"display: none\">&nbsp;</span></span></span></p>\r\n','0');");
E_D("replace into `qb_reply` values('651','','0','670','41','1','1','&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 近年来，造纸业为提高生产效率，造纸机正向高车速高宽幅发展。另外，为降低因意外故障而导致的停机，造纸机所用轴承被要求具有更高的可靠性。 ZWA今后将继续开发与提高生产效率密切相关的高可靠性轴承，始终为造纸产业的发展贡献力量。','0');");
E_D("replace into `qb_reply` values('681','','0','700','52','1','1','<p>&nbsp;&nbsp;&nbsp;&nbsp;四列圆柱滚子轴承是主要的轧辊轴承之一，其结构紧凑，刚性好，径向承载能力高，但不能承受轴向载荷。由于内圈无挡边，所以可分别安装内圈和外圈组件（带全套滚子和保持架），轴承的清洗、检查和拆卸均很方便。&nbsp;四列圆柱滚子轴承特别适用于要求高速和高精度的轧辊，如线材轧机，型材轧机和薄板冷热轧机、开坯机等的支承。<br /></p><p><a href=\"http://www.sbi.com.cn/userfiles/FC.JPG\" target=\"_blank\"><img style=\"width:160px;float:none;height:154px\" border=\"0\" hspace=\"0\" src=\"http://www.sbi.com.cn/userfiles/FC.JPG\" width=\"160\" height=\"154\" /></a><a href=\"http://www.sbi.com.cn/userfiles/FCD.JPG\" target=\"_blank\"><img style=\"width:160px;float:none;height:152px\" border=\"0\" hspace=\"0\" src=\"http://www.sbi.com.cn/userfiles/FCD.JPG\" width=\"160\" height=\"152\" /></a><a href=\"http://www.sbi.com.cn/userfiles/SFC.JPG\" target=\"_blank\"><img style=\"width:160px;float:none;height:155px\" border=\"0\" hspace=\"0\" src=\"http://www.sbi.com.cn/userfiles/SFC.JPG\" width=\"160\" height=\"155\" /></a></p><table style=\"width:580px;border-collapse:collapse\" width=\"580\" height=\"608\"><colgroup><col width=\"79\" /><col width=\"60\" /><col width=\"30\" /><col width=\"31\" /><col width=\"25\" /><col width=\"30\" /><col width=\"42\" /><col width=\"39\" /><col width=\"41\" /><col width=\"52\" /><col width=\"65\" /><col width=\"86\" /><tbody><tr height=\"19\"><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:79px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"79\">型号</td><td style=\"border-bottom:#c0c0c0 2px solid;text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:60px;background:#ffffff;height:38px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"38\" rowspan=\"2\" width=\"60\">原代号</td>