E_D("replace into `qb_reply` values('652','','0','671','1','1','1','<span style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; letter-spacing: normal; display: inline !important; font: 12px/22px simsun; white-space: normal; orphans: 2; float: none; color: rgb(0,0,0); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">&nbsp;&nbsp;&nbsp; 大连光扬轴承制造有限公司，位于中国&ldquo;轴承之都&rdquo;，大连瓦房店市北共济街，占地面积1.8万平方米，注册商标为&ldquo;ZWA&rdquo;，公司全心致力于&ldquo;进口轴承替代&rdquo;的研发创造，始终坚持&ldquo;精益求精，尽善尽美，产品出现0.01%的问题就是100%的废品！&rdquo;的质量方针。向国内外先进轴承企业学习，创造中国人自己的精品轴承，是光扬人永恒不变的追求。</span><br style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); list-style-type: none; text-indent: 0px; letter-spacing: normal; font: 12px/22px simsun; white-space: normal; orphans: 2; color: rgb(0,0,0); list-style-image: none; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\" />\r\n<span style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; letter-spacing: normal; display: inline !important; font: 12px/22px simsun; white-space: normal; orphans: 2; float: none; color: rgb(0,0,0); word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">&nbsp;&nbsp;&nbsp; 公司拥有雄厚的产品设计与开发能力，设备精良，工艺先进，公司已通过ISO9001：2000质量管理体系认证和ISO14001:2004环境管理体系认证，拥有自主进出口经营权，产品畅销全世界，出口到美国、西班牙、土耳其、意大利、巴西、南非、等十几个国家。</span><br style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); list-style-type: none; text-indent: 0px; letter-spacing: normal; font: 12px/22px simsun; white-space: normal; orphans: 2; color: rgb(0,0,0); list-style-image: none; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\" />\r\n<span style=\"widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; letter-spacing: normal; display: inline !important; font: 12px/22px simsun; white-space: normal; orphans: 2; float: none;