E_D("replace into `qb_reply` values('653','','0','672','1','1','1','<p><span style=\"background-color:#ffffff;color:#000000\">&nbsp;&nbsp;&nbsp;&nbsp;辽宁大连瓦房店质监局在日常工作中，以培养品牌工作为抓手，通过产品品牌带动作用提高科技水平，促进企业走质量效益型和品牌发展之路。目前，瓦房店市6种轴承产品获辽宁省名牌产品，17种产品获大连名牌产品，15种产品获瓦房店市名牌产品。其中，有5家企业获瓦房店市市长轴承质量奖，1家企业获辽宁省省长质量奖。<br />&nbsp;&nbsp;&nbsp;&nbsp;轴承产业是大连市标志性产业和第一工业品牌，为此，瓦房店质监局以突出轴承产业品牌建设为重点，不断推进品牌建设工作。一是帮助企业恢复建立计量室，全面加强企业技术基础建设。二是以规模以上轴承企业为名牌产品培育对象，带动全市品牌创建工作，大力实施品牌战略。同时，实施层级培育品牌。《发展和争创名牌产品实施意见》、《瓦房店市名牌产品管理办法》和《瓦房店市人民政府关于印发瓦房店市市长轴承质量奖管理办法的通知》的制定和下发，对品牌建设起到了积极的推进作用。三是不断规范轴承市场秩序。加强对全市轴承企业的检查，重点查处假冒厂名厂址、假冒产品标识、假冒产品合格证等违法行为；加强对铁路、公路等物资配货站和发运点的检查，对发往外埠的假冒轴承产品及无标识光板成品轴承，依法予以扣押；与企业联合开展打假，突出打假的针对性。</span></p>','0');");
