E_D("replace into `qb_reply` values('658','','0','677','1','1','1','<p><span style=\"background-color:#ffffff;color:#000000\">&nbsp;&nbsp;&nbsp;&nbsp;瓦房店市于2007年获得“中国轴承之都”称号。几年来，瓦房店轴承产业发展迅速，产业结构得到优化，技术水平大幅度提高，核心竞争力显著增强，市场占有率明显提升，成为全国最大的轴承产业集聚区，保持着“中国轴承之都”的优势。<br /></span>几年来，瓦房店市充分利用“中国轴承之都”品牌优势，以转变经济发展方式为主线，以产业结构调整为抓手，以科技创新为突破口，全力推进轴承产业的转型升级，实现了从规模增长型向质量效益型的转变，为我国在轴承大国向轴承强国迈进的历史进程中和装备制造业的发展作出了突出的、历史性的贡献。瓦房店市政府编制的《轴承产业发展规划纲要》及《轴承城战略发展规划》具有科学性、前瞻性、指导性和基础性，符合国家产业政策和发展重点，内容具体，具有可操作性，可以指导瓦房店轴承产业今后5至10年的发展。</p><p><span style=\"background-color:#ffffff;color:#000000\"></span>&nbsp;</p>','0');");
